import React from "react";

function AppointmentsPage() {
    return (
        <div style={styles.page}>
            <h1>Rendez-vous</h1>
            <p>Planifiez et suivez vos rendez-vous médicaux en toute simplicité.</p>
        </div>
    );
}

const styles = {
    page: {
        textAlign: "center",
        padding: "50px",
    },
};

export default AppointmentsPage;
